import React, { useState } from 'react';

const defaultEquipment = [
  { id: 'bench-press', name: 'Bench Press', videoId: 'rT7DgCr-3pg' },
  { id: 'leg-press', name: 'Leg Press', videoId: 'IZxyjW7MPJQ' },
  { id: 'lat-pulldown', name: 'Lat Pulldown', videoId: 'CAwf7n6Luuc' },
  { id: 'chest-press', name: 'Chest Press Machine', videoId: 'xUm0BiZCWzQ' },
  { id: 'leg-extension', name: 'Leg Extension', videoId: 'YyvSfVjQeL0' },
  { id: 'leg-curl', name: 'Leg Curl', videoId: 'ELOCsoDSmrg' },
  { id: 'shoulder-press', name: 'Shoulder Press', videoId: 'Wqq43dKW1TU' },
  { id: 'cable-row', name: 'Cable Row', videoId: 'GZbfZ033f74' },
  { id: 'smith-machine', name: 'Smith Machine', videoId: 'Iwe6AmxVf7o' },
  { id: 'elliptical', name: 'Elliptical', videoId: 'c5Kv3-NGtX8' },
  { id: 'treadmill', name: 'Treadmill', videoId: 'YaXPRqUwItQ' },
];

export default function AIWorkoutGenerator() {
  const [selectedEquipment, setSelectedEquipment] = useState([]);
  const [workout, setWorkout] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleEquipmentChange = (equipmentId) => {
    setSelectedEquipment(prev => 
      prev.includes(equipmentId)
        ? prev.filter(id => id !== equipmentId)
        : [...prev, equipmentId]
    );
  };

  const generateWorkout = async () => {
    setLoading(true);
    setError(null);

    const availableEquipment = selectedEquipment
      .map(id => defaultEquipment.find(e => e.id === id).name)
      .join(', ');

    try {
      const response = await fetch('/api/generate-workout', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          equipment: availableEquipment,
          profile: {
            weight: 102,
            height: 176,
            gender: 'woman',
            goals: ['fat loss', 'strength'],
          },
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to generate workout');
      }

      const data = await response.json();
      setWorkout(data.workout);
    } catch (err) {
      setError('Failed to generate workout. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <div className="bg-white rounded-xl shadow-lg overflow-hidden">
        {/* Equipment Selection */}
        <div className="p-6">
          <h2 className="text-xl font-bold mb-4">Select Available Equipment</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {defaultEquipment.map((equipment) => (
              <label
                key={equipment.id}
                className="flex items-center p-4 rounded-lg border cursor-pointer hover:bg-gray-50 transition-colors"
              >
                <input
                  type="checkbox"
                  checked={selectedEquipment.includes(equipment.id)}
                  onChange={() => handleEquipmentChange(equipment.id)}
                  className="h-5 w-5 text-blue-600 rounded"
                />
                <span className="ml-3">{equipment.name}</span>
              </label>
            ))}
          </div>
        </div>

        {/* Generate Button */}
        <div className="px-6 pb-6">
          <button
            onClick={generateWorkout}
            disabled={selectedEquipment.length === 0 || loading}
            className={`w-full py-3 px-6 rounded-lg text-white font-semibold ${
              selectedEquipment.length === 0 || loading
                ? 'bg-gray-400 cursor-not-allowed'
                : 'bg-blue-600 hover:bg-blue-700'
            }`}
          >
            {loading ? 'Generating Workout...' : 'Generate AI Workout Plan'}
          </button>
        </div>

        {/* Error Message */}
        {error && (
          <div className="px-6 pb-6">
            <div className="bg-red-100 text-red-700 p-4 rounded-lg">
              {error}
            </div>
          </div>
        )}

        {/* Workout Plan */}
        {workout && (
          <div className="border-t border-gray-200">
            <div className="p-6">
              <h2 className="text-xl font-bold mb-6">Your Personalized Workout Plan</h2>
              <div className="space-y-6">
                {workout.map((exercise, index) => {
                  const equipmentItem = defaultEquipment.find(
                    e => e.name.toLowerCase() === exercise.name.toLowerCase()
                  );

                  return (
                    <div key={index} className="bg-gray-50 rounded-lg p-6">
                      <h3 className="text-lg font-semibold mb-2">{exercise.name}</h3>
                      <div className="text-gray-600 mb-4">
                        {exercise.sets} sets Ã— {exercise.reps} reps
                        {exercise.notes && (
                          <p className="mt-2 text-sm">{exercise.notes}</p>
                        )}
                      </div>
                      {equipmentItem && (
                        <div className="aspect-w-16 aspect-h-9">
                          <iframe
                            src={`https://www.youtube.com/embed/${equipmentItem.videoId}`}
                            title={`How to do ${exercise.name}`}
                            className="w-full rounded-md"
                            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                            allowFullScreen
                          />
                        </div>
                      )}
                    </div>
                  );
                })}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
